	private static JSONArray jsonObjectToJSONArray(JSONObject jsonObj) {
		JSONArray jsonArray = new JSONArray();
		Iterator<?> keys = jsonObj.keys();
		//ArrayList<HashMap<String, Object>> value = new ArrayList<>();
		ArrayList<HashMap<String, String[]>> value = new ArrayList<>();
		
		try {
		    while( keys.hasNext() ) {
		        String key = (String)keys.next();
		        if(!key.equals("RESULT_COUNT")) {
		        	HashMap<String, String[]> tmp = new HashMap<>();
		        	tmp.put(key, (String[]) objectToStringArray(jsonObj.get(key)));
		        	value.add(tmp);
		        }
		    }
		    //System.out.println("=====>value:"+value);
	    	
	    	HashMap<String, String[]> tmp = new HashMap<>();
	    	int dataCnt = 0;
	    	if(value.size() > 0) {
	    		tmp = value.get(0);
	    		for (String key : tmp.keySet()) {
	    			String[] tmpArr = tmp.get(key);
	    			dataCnt = tmpArr.length;
	    			if(dataCnt != 0) break;
	    		}
	    		
	    	}
	    	System.out.println("dataCnt:"+dataCnt);
	    	System.out.println("keyCnt:"+value.size());
	    	
	    	JSONObject jo = new JSONObject();
	    	for(int i = 0 ; i < dataCnt ; i++ ) {
	    		//System.out.println("i"+i);
		    	Iterator<?> keyset = jsonObj.keys();
		    	int keyIdx = 0;
	    		while( keyset.hasNext() ) {
			        String key = (String)keyset.next();
			        if(!key.equals("RESULT_COUNT")) {
			        	//System.out.println("key::"+key);
				        if(!key.equals("RESULT_COUNT")) {
				        	jo.put(key, ((String[])value.get(keyIdx).get(key))[i]);	
				        	//System.out.println(key+":"+ ((String[])value.get(keyIdx).get(key))[i]);
				        	++keyIdx;
				        }
			        }
		        	
			    }
	    		jsonArray.put(jo);
	    		//System.out.println(i+">>resultJa::"+resultJa);
	    		jo = new JSONObject();
	    	}
	    	//System.out.println("====total resultJa"+jsonArray);
		    
		} catch (JSONException e) {
			e.printStackTrace();
		}
		
		return jsonArray;
	}


	private static Object objectToStringArray(Object object) {
		return object.toString().replaceAll("\\[", "").replaceAll("\\]", "").replaceAll("\"", "").split(",");
		 
	}


	public static JSONObject objectToJSONObject(Object object){
	    Object json = null;
	    JSONObject jsonObject = null;
	    try {
	        json = new JSONTokener(object.toString()).nextValue();
	    } catch (JSONException e) {
	        e.printStackTrace();
	    }
	    if (json instanceof JSONObject) {
	        jsonObject = (JSONObject) json;
	    }
	    //System.out.println("=====objectToJSONObject return:"+jsonObject);
	    return jsonObject;
	}

